import React, { Component } from 'react';
import '../App.css';
import Daph from '/Users/deankrotzer/Desktop/Github/Homeraisedcairns/frontend/src/pages/daphblanket.jpg';
import kayakingYoda from '/Users/deankrotzer/Desktop/Github/Homeraisedcairns/frontend/src/pages/kayakingYoda.jpg';
import toto from '/Users/deankrotzer/Desktop/Github/Homeraisedcairns/frontend/src/pages/toto.jpg';
import AboutCairns from '../pages/AboutCairns';
import { Card, CardDeck  } from 'react-bootstrap';
import{ BrowserRouter, Link } from 'react-router-dom';


class AboutDiet extends Component {
    render(){
      return (

<div>
  <h1>Diet</h1>
  <p>
    I normally dont rely on dry dog food alone to provide my dogs nutrition.
    The first year I feed an all organic diet with Castor & Pollux Organix Grain free Organic Small Breed recipe.
    But after I noticed the Oranix dog food had got some sharp peices that was so shape it started hurting my puppies mouth.
    I then looked at every other dog food and started to feed fresh pet select as it is readily avalibale at walmart.
    Unfortunitly, i still found a need for dry dog food for when i wasnt home for longer periods. 
    I ended up with Blue buffalo small breed or Blue Wilderness small breed, for a dry dog food option.

  </p>

  <h2> Assesorries </h2>
  <p>
    I went through many harnesses from petco, walmart, etc. 
    My dogs and I where always on the go and the clothe of these harness wernt holding up.
    I also went through a few leashes as well, most of them would unravel near the end where the leash hooks to the harness.
    I found the best success in getting a thicker canvas type material leash and harness was the best, although nothing stands up to a cairns teeth so dont let them chew it and this leash setup will last the longest.
    I got multiple sized leashes one small for when they were younger and started them as young as i could to get them to get as used to the harness as i could.

  </p>
</div>





      ); 
    }
  }

  export default AboutDiet;
